import './stylesheets/App.scss';
import logo from './assets/images/logo.svg';

function App() {
  return (
    <div className="App">
        <AppHeader/>
    </div>
  );
}

export default App;

const AppHeader = () => {
  return (
    <header>
        <div className='container'>
          <div className='header-wrapper'>
              <img src={logo} alt="Logo"/>
              <div className='right'></div>
          </div>
        </div>
    </header>
  )
}
export {AppHeader};
